import React, { useState, useEffect } from 'react';
import { useSpring, animated } from 'react-spring';
import { Menu } from '@headlessui/react';
import { ChevronDownIcon, SunIcon, MoonIcon, MenuIcon } from '@heroicons/react/outline';
import { Link } from 'react-router-dom';

const Header = () => {
  const [darkMode, setDarkMode] = useState(false);
  const [scrolled, setScrolled] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  // Animation de la navbar
  const navbarSpring = useSpring({
    backgroundColor: scrolled ? 'rgba(0, 0, 0, 0.8)' : 'transparent',
    config: { duration: 300 },
  });

  // Gérer le défilement
  const handleScroll = () => {
    setScrolled(window.scrollY > 50);
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <animated.nav style={navbarSpring} className="fixed top-0 left-0 w-full z-50 shadow-md transition-all">
      <div className={`flex items-center justify-between p-4 ${darkMode ? 'bg-gray-800' : 'bg-gray-100'} transition-colors`}>
        <Link to="/" className="text-2xl font-bold text-gray-900 dark:text-gray-100">
          <img src="/logo.svg" alt="Logo" className="w-8 h-8 inline" />
          Brand
        </Link>
        <div className="hidden md:flex space-x-4">
          <Link to="/" className="text-gray-900 dark:text-gray-100 hover:text-blue-500">Home</Link>
          <Link to="/about" className="text-gray-900 dark:text-gray-100 hover:text-blue-500">About</Link>
          <Menu as="div" className="relative inline-block text-left">
            <Menu.Button className="inline-flex items-center text-gray-900 dark:text-gray-100 hover:text-blue-500">
              More
              <ChevronDownIcon className="ml-2 w-5 h-5" />
            </Menu.Button>
            <Menu.Items className="absolute right-0 w-48 mt-2 origin-top-right bg-white dark:bg-gray-800 border border-gray-300 dark:border-gray-700 rounded-md shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none">
              <div className="py-1">
                <Menu.Item>
                  {({ active }) => (
                    <Link
                      to="/services"
                      className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100 dark:bg-gray-700 text-gray-900 dark:text-gray-100' : 'text-gray-700 dark:text-gray-300'}`}
                    >
                      Services
                    </Link>
                  )}
                </Menu.Item>
                <Menu.Item>
                  {({ active }) => (
                    <Link
                      to="/contact"
                      className={`block px-4 py-2 text-sm ${active ? 'bg-gray-100 dark:bg-gray-700 text-gray-900 dark:text-gray-100' : 'text-gray-700 dark:text-gray-300'}`}
                    >
                      Contact
                    </Link>
                  )}
                </Menu.Item>
              </div>
            </Menu.Items>
          </Menu>
        </div>
        <button
          onClick={() => setDarkMode(prev => !prev)}
          className="p-2 text-gray-900 dark:text-gray-100"
        >
          {darkMode ? <SunIcon className="w-6 h-6" /> : <MoonIcon className="w-6 h-6" />}
        </button>
        <button
          onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
          className="md:hidden p-2 text-gray-900 dark:text-gray-100"
        >
          <MenuIcon className="w-6 h-6" />
        </button>
      </div>
      {/* Menu mobile */}
      {mobileMenuOpen && (
        <div className="md:hidden bg-gray-100 dark:bg-gray-800">
          <Link to="/" className="block px-4 py-2 text-gray-900 dark:text-gray-100 hover:bg-gray-200 dark:hover:bg-gray-700">Home</Link>
          <Link to="/about" className="block px-4 py-2 text-gray-900 dark:text-gray-100 hover:bg-gray-200 dark:hover:bg-gray-700">About</Link>
          <Link to="/services" className="block px-4 py-2 text-gray-900 dark:text-gray-100 hover:bg-gray-200 dark:hover:bg-gray-700">Services</Link>
          <Link to="/contact" className="block px-4 py-2 text-gray-900 dark:text-gray-100 hover:bg-gray-200 dark:hover:bg-gray-700">Contact</Link>
        </div>
      )}
    </animated.nav>
  );
};

export default Header;
